import React from "react";
import './About.css';
const About = () => {
    return(
      <div>
           <div class="main-22">
        <div class="sub-div sub-div1">
            <div class="inner-div inner-div1"></div>
            <div class="inner-div inner-div2"></div>
        </div>
        <div class="sub-div sub-div2">
            <div class="inner-div inner-div1"></div>
            <div class="inner-div inner-div2"></div>
        </div>
        <div class="sub-div sub-div3">
            <div class="inner-div inner-div1"></div>
            <div class="inner-div inner-div2"></div>
        </div>
        <div class="sub-div sub-div4">
            <div class="inner-div inner-div1"></div>
            <div class="inner-div inner-div2"></div>
        </div>
    </div>
    </div>
    );
  };
export default About;
